css:
.clipboard-history ol.list-group {
  position: static;
}
.clipboard-history ol.list-group .preview {
  position: absolute;
  top: 42px;
  left: 370px;
  opacity: 0.7;
}
.clipboard-history ol.list-group .preview pre {
  width: 330px;
  height: auto;
  max-height: 400px;
  font-family: Inconsolata, Monaco, Consolas, 'Courier New', Courier;
  font-size: 9px;
  border-radius: 2px;
  overflow-x: scroll;
}
